typedef enum
{
	NEW_SIO_DATA = 0,
} audioplayer_msg_type_e;


typedef struct {
    audioplayer_msg_type_e msgType;
    char indata;
} ap_msg_mail_t;


#define     AUDIO_BUFFER_SIZE       1024 * 32
#define     AUDIO_BULK_SIZE         1024 * 64

char _audioBuffer[AUDIO_BUFFER_SIZE];

Mail<ap_msg_mail_t, 32> ap_msg_mail_box;
UnbufferedSerial pc(PA_9, PA_10); // tx, rx
DigitalOut LED(LED1);


void Sio_isr()
{
	char ch;
	ap_msg_mail_t* mail;

	pc.read(&ch, 1);

	mail = (ap_msg_mail_t*)ap_msg_mail_box.alloc();

	if (mail != NULL)
	{
        mail->msgType = NEW_SIO_DATA;
        mail->indata = ch;
        ap_msg_mail_box.put(mail);
	}    
}

int main(void)
{
	osEvent evt;
    int bufIdx = 0;
	ap_msg_mail_t* mail;

	printf("--- Start Audio Test ---\r\n");
	pc.baud(460800);
	pc.attach(Sio_isr, SerialBase::RxIrq);

    int ret_aud = AudioPlayer_Init();
    AudioPlayer_SetConfig(AUDIO_BULK_SIZE, 44000, true);
    AudioPlayer_Start((uint16_t*)wave_table, sizeof(wave_table));

	while (true)
    {
		evt = ap_msg_mail_box.get(1000);

		if (evt.status == osEventMail)
		{
			mail = (ap_msg_mail_t*)evt.value.p;
			switch (mail->msgType)
			{
				case NEW_SIO_DATA:
                    _audioBuffer[bufIdx++] = mail->indata;
                    if (bufIdx >= AUDIO_BUFFER_SIZE)
                    {
                        bufIdx = 0;
                    }
					break;
            }

			ap_msg_mail_box.free(mail);		
        }
    }

	return 0;
}

